// StudentApartmentCard.js
import React from "react";
import "./StudentApartmentCard.css";

const StudentApartmentCard = ({ image, name, address, price, specifications }) => {
  // Check if it's a local uploaded image (not an external URL)
  const imageUrl = image.startsWith("http") ? image : `http://localhost:5051/uploads/${image}`;

  return (
    <div className="student-apartment-card">
      <img src={imageUrl} alt={name} className="apartment-image" />
      <h3>{name}</h3>
      <p>{address}</p>
      <p>${price}/month</p>
      <ul>
        {specifications?.map((spec, idx) => (
          <li key={idx}>{spec}</li>
        ))}
      </ul>
    </div>
  );
};

export default StudentApartmentCard;
